// Counting Valleys

/* An avid hiker keeps meticulous records of their hikes. During the last hike that took exactly STEPS  steps, for every step it was noted if it was an uphill, U, or a downhill, D step. Hikes always start and end at sea level, and each step up or down represents a 1 unit change in altitude. We define the following terms:

A mountain is a sequence of consecutive steps above sea level, starting with a step up from sea level and ending with a step down to sea level.

A valley is a sequence of consecutive steps below sea level, starting with a step down from sea level and ending with a step up to sea level.

Given the sequence of up and down steps during a hike, find and print the number of valleys walked through.

Complete the countingValleys function in the editor below.

countingValleys has the following parameter(s):

int steps: the number of steps on the hike
string path: a string describing the path

 */

function countingValleys(steps, path) {
    // Write your code here
    console.log('tracking hike');

    // variable to mark current step of the hike
    // for the while loop to use as an index
    let currentStep = 0;

    // variable to mark the end of the hike
    let hikeEnd = steps - 1;

    // create array to store the distance
    // traveled from the beginning of the hike (0)
    let elevationFromStart = 0;

    // create variable to store the 
    // number of valleys travelled in a hike
    let valleysTravelled = 0;

    // loop for as long as the value of currentStep
    // is less than or equal to hikeEnd 
    while (currentStep <= hikeEnd) {

        /* conditional checks if the direction of the
        path at the current step is uphill or downhill
        and will... */
        if (path[currentStep] === 'D') {

            // decrement the elevation if the direction
            // is downhill or...
            elevationFromStart--
        } else if (path[currentStep] === 'U') {

            // increment the elevation if the
            // direction is uphill
            elevationFromStart++
        }

        /* conditional checks for the downhill direction
        and an elevation of -1 signaling the entrance of
        a valley and will */
        if (path[currentStep] === 'D' && elevationFromStart === -1){ 

            // increment the count of valleys travelled
            valleysTravelled++
        }

        // increment the currentStep to check
        // the next consecutive index
        currentStep++;
    } // end while loop
    
    // return the number of valleys travelled
    return valleysTravelled;
}

console.log(countingValleys(1000000, ''))